import styled from "styled-components";

const Ex = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin: 90px 0px 100px 0px;
`;
const H1 = styled.h1`
  font-size: 37px;
  font-weight: 300;
  height: 58px;
`;

const Button = styled.div`
  display: flex;
`;
const Mainbutton1 = styled.button`
  background-color: #007bff;
  margin: 0.25rem 0.15rem;
  padding: 0.5rem 0.75rem;
  color: white;
  border-radius: 0.25rem;
  border: 1px;
  font-size: 1rem;
  text-align: center;
  &:hover {
    transition: 0.1s ease-in;
    filter: brightness(0.7);
    cursor: pointer;
  }
  &:not(:hover) {
    transition: 0.1s ease-out;
  }
  &:focus {
    box-shadow: 0 0 0 0.2rem rgba(0, 123, 255, 0.5);
  }
`;
const Mainbutton2 = styled.button`
  background-color: #6c757d;
  margin: 0.25rem 0.15rem;
  padding: 0.5rem 0.75rem;
  color: white;
  border-radius: 0.25rem;
  border: 1px;
  font-size: 1rem;
  text-align: center;
  &:hover {
    transition: 0.1s ease-in;
    filter: brightness(0.7);
    cursor: pointer;
  }
  &:not(:hover) {
    transition: 0.1s ease-out;
  }
  &:focus {
    box-shadow: 0 0 0 0.2rem rgba(108, 117, 125, 0.5);
  }
`;
function Maincomponent() {
  return (
    <Ex>
      <H1>Album example</H1>
      <P>
        Something short and leading about the collection below—its contents
        <br />, the creator, etc. Make it short and sweet, but not too short so
        folks don’t <br />
        simply skip over it entirely.
      </P>
      
        <Button
          onHoverColor={"rgba(0,105,217,1)"}
          onClick={console.log("hi")}
          height={"40px"}
          width={"150px"}
          border={"none"}
          fsize={"17px"}
          fcolor={"white"}
          text={"Main call to action"}
          color={"rgba(0,123,255)"}
        ></Button>
        <Button
          onHoverColor={"rgba(90,98,104,1)"}
          height={"40px"}
          width={"150px"}
          fsize={"17px"}
          fcolor={"white"}
          border={"none"}
          text={"Secondary action"}
          color={"gray"}
        ></Button>
      
    </Ex>
  );
}
export default Maincomponent;
